import { View, Text } from "react-native";
import React from "react";

const TutorialStep = (props) => {
  const { children } = props;
  return (
    <>
      <View
        style={{
          backgroundColor: "rgba(0,0,0,0.5)",
          flex: 1,
          position: "absolute",
          height: "100%",
          width: "100%",
        }}
      />
      {children}
    </>
  );
};

export default TutorialStep;
